import React from "react";
import Logo from "./components/Logo";
import Dropdown from "./Dropdown";
import Nav from "./components/Nav";
import Form from "./components/Form";
function App() {
    return (
        <>
            <div>
                <Logo />
                <Dropdown />
                <Nav />
                <Form />
            </div>
        </>
    )
}
export default App;
